    function out_h = h( this, in_1, ~, t )
      % Calculate the residual of the invariants h.

      % Extract properties
      L__s2 = this.m_L__s2;
      L__s3 = this.m_L__s3;
      R__g2 = this.m_R__g2;
      R__g3 = this.m_R__g3;
