      y__2 = in_1(2);
      y__3 = in_1(3);
      y__4 = in_1(4);
      y__5 = in_1(5);
      y__6 = in_1(6);
      y__7 = in_1(7);
      y__10 = in_1(10);
      y__11 = in_1(11);
      y__12 = in_1(12);
      y__13 = in_1(13);

      % Evaluate function
      t2 = sin(0.6283185308e5 * t);
      t3 = 0.2e1 * t2;
      t6 = exp((y__4 + y__5 + y__7 + t3) * delta);
      t7 = t6 * 0.577215664901532860606512090082e0;
      t11 = exp(-(y__4 - 0.1e1 * y__6 + y__7 + t3) * delta);
      t12 = t11 * 0.577215664901532860606512090082e0;
      out_1 = -t7 + t12 - y__11;
      t15 = exp((y__3 - y__5 - y__7 - t3) * delta);
      t16 = t15 * 0.577215664901532860606512090082e0;
      out_2 = -t7 + t16 + y__12;
      t19 = exp(-delta * (y__3 + y__6 - y__7 - t3));
      t20 = t19 * 0.577215664901532860606512090082e0;
      out_3 = t20 - t12 - y__13;
      out_4 = t20 - t16 + y__10;
      t23 = L__s2 * 0.500000000000000000e0 - 0.500000000000000000e0 * L__s3;
      t26 = R__g2 * L__s3;
      t29 = R__g3 * L__s2;
      out_5 = 0.1e1 / L__s3 / L__s2 * (y__1 * t23 + y__2 * t23 + y__12 * t26 * 0.1e1 + y__11 * t29 * 0.1e1 + y__10 * t26 * 0.1e1 + y__13 * t29 * 0.1e1 + L__s3 * y__5 * 0.1e1 - 0.1e1 * L__s2 * y__4 + L__s3 * y__3 * 0.1e1 - 0.1e1 * L__s2 * y__6);

      % Store outputs
      out_h = zeros(5, 1);
